$primary-violet: hsl(256, 26%, 20%);
$primary-blue: hsl(216, 30%, 68%);
$neutral-violet: hsl(270, 9%, 17%);
$neutral-grey: hsl(273, 4%, 51%);
$neutral-ltgrey: hsl(0, 0%, 98%);
$white: #FFF;
$font-size: 16px;
$width: 85vw;

$desktop: 800px;

@mixin button($color, $bgColor) {
    padding: 2vh 4vw;
    border: 2px solid $color;
    background: $bgColor;
    color: $color;
    font-size: $font-size;
    font-family: 'Karla', sans-serif;
    text-transform: uppercase;
    box-shadow: 0px 0px 5px -1px $neutral-grey;
    cursor: pointer;
}

@mixin media($px) {
    @media (min-width: $px){
        @content;
    }
}

