    text-align: center;
    @media (min-width: $desktop) {
        text-align: left;
    }
    width: 100vw;
    overflow-x: hidden;
    &::selection {
        color: $primary-blue;
        background: $white;
    }
}

h1 {
    font-family: 'DM Serif Display', serif;
